import React , {Component} from 'react'

class Tabs extends Component {

    render(){
        return (
        <p className="panel-tabs">
            <a className="is-active">All</a>
            <a>Public</a>
            <a>Private</a>
            <a>Sources</a>
            <a>+Add</a>
        </p>
        )
    }
}

export default Tabs
